import React from 'react';
import {Box, Button, ButtonGroup, Flex, Heading, VStack} from "@chakra-ui/react";

const FoundQuiz = () => {
    return (
        <Box bg={'gray.100'} minH={'100vh'}>

             <Flex  flex={7} w={'100%'} direction={'column'}>
                 <Box>
                     <VStack pt={10} spacing={4} w={500}>
                         {/*  QUIZ TITLE*/}
                         <Heading>Quiz title</Heading>
                         {/*  ACTION BUTTONS*/}
                         <VStack boxShadow={'md'} p={4} bg={'white'} minW={'200px'} spacing={4}>
                             <Button w={'100%'} colorScheme={'teal'}>Start</Button>
                             <Button w={'100%'} colorScheme={'blue'}>Share</Button>
                             <Button w={'100%'} colorScheme={'gray'}>Cancel</Button>
                         </VStack>
                         {/*    OPTIONS*/}
                         <Box minW={200}  bg={'white'}>
                             OPTIONs BOX
                         </Box>
                     </VStack>
                 </Box>
             </Flex>
        </Box>
    );
};

export default FoundQuiz;
